package dsa_14th_June_2022;

public class MultiplationTableof3 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		int n = 30;
		//Keep printing multiplication table until you get n
		
		for(int i=1;i<=n;i++) {
			int num = 3 * i;
			System.out.println(num);
		}
		
		
		
	}

}
